import React, { Component } from 'react';
import { Menu, Icon } from 'antd';
import { Route, NavLink, Switch } from 'react-router-dom';

const SubMenu = Menu.SubMenu;
const MenuItemGroup = Menu.ItemGroup;
class LeftMenu extends Component {
  render() {
    return (
   <Menu mode="horizontal" className = "navColor">
       <Menu.Item key="interviews">
          <NavLink to = "/interview-corner"><a href=""  style = {{ color: "white" }}>Interviews</a></NavLink>
        </Menu.Item>
        <SubMenu title={<span>Practice</span>}>
          <MenuItemGroup title="Test Skills">
            <Menu.Item key="setting:1">Aptitude</Menu.Item>
            <Menu.Item key="setting:2">Technical</Menu.Item>
          </MenuItemGroup>
          <MenuItemGroup title="Apply">
            <Menu.Item key="setting:3"><NavLink to = "/new-jobs/" exact >New Job Openings</NavLink></Menu.Item>
          </MenuItemGroup>
        </SubMenu>
        <Menu.Item key="alipay">
          <a href=""  style = {{ color: "white" }}>Contact Us</a>
        </Menu.Item>
      </Menu>
    );
  }
}
export default LeftMenu;
